;\n\nwindow._bt_autoscale_timeout = setTimeout(function () {\n    /**\n     * @variable cb_obj `fig_ohlc.x_range`.\n     * @variable source `ColumnDataSource`\n     * @variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"2546475","type":"CustomJS"},{"attributes":{"data":{"equity_dd":{"__ndarray__":"AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA//FbKtvwV8D/WtWqVaOLvP9NOyZqRqO8/HL9589D17j+o1+8LZPTuP+3F2fbyue4/hcIp9eHX7j94/KCwQPLuP/ZOjoQyC+8/jS2N4Wbv7j+u5y2gzD3vP0JrB6XkU+8/w1S8E2iu7z/maYIq6srvP27N3wYxTu8/LBzK0gMd7z9YYFGTld3uPxnsDxbKQO4/VYSAXCDB7T/bmcHU4cztPxFdvqCGie0/0h8IO8Zv7j/90lqNN13uPw/Ul1DCpu4/Q+KMDHOc7j8iIM0DWSnvPwNGBfnaDe8/JJ614Qzz7j/C9HXVTrjvP/mAU2+zd+8/4aJcIJ3v7j/XkrKmaSDvP4xQkDmGUO8/ImvF82Ri7z+zvBngg3HvPx7t3BWxmO8/R4xWqlZK7z8bjgto2SPvP1V5uq8VWO8/rUlvdODA7j/jaz3uXPLuP4dz1q36Ee8/y24vb2oV7z+gBtUMBWHvP1hCm33VWu8/8I/AJVz97j9rredgSDLvPydIf3/woO8/jpuIKZKJ7z87s8tiY3j
